SELECT CASE WHEN row_number() OVER(ORDER BY SchoolYear) = 1 THEN '(' ELSE ',(' END + 
CAST(EdOrgId AS VARCHAR(20)) + ',''' + 
(SELECT CodeValue + ''',''' + CodeType + '''' FROM EdOrgCodeList WHERE Id = EOC.CharacteristicId) +
')' AS [DynamicSQL]
FROM EdOrgCharacteristic EOC
WHERE SchoolYear = 2024 
AND EOC.EdOrgId IN (
SELECT EO.EdOrgId
FROM vw_district_location VDL
LEFT JOIN vw_EdOrgs EO WITH (NOLOCK) 
	ON (EO.EdOrgId = VDL.EdOrgId_School 
		AND EO.SchoolYear = VDL.SchoolYear)
WHERE EO.SchoolYear = 2024
AND VDL.LocationStatus IN ('Active','New','Reopened','Changed')
AND VDL.LocationCategory IN ('Public','Charter','Off-Site','Central Office','State Supported')
AND VDL.DistrictCategory IN ('State District','State Charter','State Supported'))

*/
